import React from 'react';
import "./Root.css";

function LeftArea () {
  return (
    <div className = "left-area">
      <div className = "desin_system">
        Design
        System
        for ITRM
      </div>
      <div className = "style_guide">
        STYLE GUIDE
      </div>
      <div className = "style_guide_elements">
        <Btn name = "Color">Color</Btn>
        <Btn name = "Typography">Typography</Btn>
        <Btn name = "Icon">Icon</Btn>
        <Btn name = "Logo">Logo</Btn>
      </div>
      <div className = "ui_component">
        UI Component
      </div>
      <div className = "ui_component_elements">
        Buttons
        Toggles
        Input Fields
        Dropdown Menus
        ToolTips & Markers
        Notifications
        Modals
        Empty States
        Date Pickers
        Grid List
        Data Tables
      </div>
    </div>
  );
}

function Contents(){
  
  return <div className = "content-area">
   
    </div>;
}

function Root() {
  return(
      <div>
        <LeftArea />
      </div>
    );
}

export default Root;
